var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Wed', 'text': '\n \n 2019 Fall Computer aided design \n \n http://mde.tw/cad2019/content/index.html \n \n 2019 Fall Computer program \n \n http://mde.tw/cp2019/content/index.html \n \n youtube \n \n https://www.youtube.com/channel/UCJ0Ye3mhMApH0yxAcwCXs5g/videos \n \n Dartpad\xa0 \xa0 \xa0 \xa0 https://mde.tw/dartpad/ \n \n', 'tags': '', 'url': 'Wed.html'}, {'title': '亂數分組', 'text': '\xa0上課第一週即進行學員亂數分組 \n 流程圖符號說明 \n \n 基本流程: \n 1.獲得班級修課成員名單 \n 2.決定各組人數 \n 3.弄亂成員學號資料的次序 \n 4.決定好每組幾人, 從頭開始分組, 以確定各組成員 \n 5.若最後一組人數過少, 將分別依序捕到前述已經分組的組別中 \n 6.在課程加退選階段結束後, 不排除重新分組 \n', 'tags': '', 'url': '亂數分組.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Dart2基本語法', 'text': '', 'tags': '', 'url': 'Dart2基本語法.html'}, {'title': '上課影片', 'text': '\n', 'tags': '', 'url': '上課影片.html'}, {'title': 'Dart解微分方程式', 'text': '老師講解影片 \n \n 重點整理： \n 1.Dart 程式語言的執行與傳統的 C 語言程式相同,都 \xa0 必須從 main() 主函式開始執行 \n 2.Dart 程式語法使用 ";" 隔開 完整的可執行程式段 , 並利用大括號 "{}" 來區隔程式區段 \n 3.Dart 程式擁有資料型別推斷的設計, 可是在變數內容存放特定資料型別後, 將無法再自動轉為其他型別資料 \n 4. 使用者也可以自行利用\xa0 https://github.com/dart-lang/dart-services \xa0程式碼, 自行建立 Dartpad 所需的後端伺服器，並修改 Dartpad 前端的設定便可在區域網路中運行 Dartpad 服務. \n 5.另一種利用Dartpad 引用 Dart 程式的方法為 Github 倉儲資料引用，引入包含 index.html 與 style.css 以及 .dart 程式的網際程式 \n gh_owner - 宣告 github 擁有者, 即 Github 登入帳號. \n gh_repo - 宣告所使用的 github 倉儲. \n gh_path - 宣告 github 資料目錄所在路徑. \n theme - 宣告所要引用的頁面顏色主題, 設為 dark 表示使用暗色系頁面. \n run - 設為 true 表示頁面引用後, 程式直接執行 \n', 'tags': '', 'url': 'Dart解微分方程式.html'}, {'title': 'Q＆A', 'text': 'Q1：使用python開近端時，flaskapp.py出現錯誤 \n \n \n A：使用pip install -U flask-cors安裝模組. \n \n Q2 : 無法執行ffmpeg \n A1 : ffmpeg.exe 複製一份, 放到 y:即可在命令列任何地方執行 ffmpeg 指令. \n A2 : 將已經存在隨身碟的 ffmpeg.exe, 所在目錄放入 path 命令搜尋路徑之中. \n Q3 : 如何在Dart語法中打次方 \n A : 可 參考\xa0 https://api.dartlang.org/stable/2.6.0/dart-math/dart-math-library.html \xa0 中的說明 \n', 'tags': '', 'url': 'Q＆A.html'}, {'title': '建置Blog步驟', 'text': '\n', 'tags': '', 'url': '建置Blog步驟.html'}, {'title': 'Dart按鈕', 'text': '純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping \n 溫度轉換 \n 數列、重複迴圈 \n for c-f \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery \n temperature-1 \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n  footer  \n', 'tags': '', 'url': 'Dart按鈕.html'}, {'title': 'W16查驗考試', 'text': '\n', 'tags': '', 'url': 'W16查驗考試.html'}, {'title': 'SSH操作影片', 'text': '', 'tags': '', 'url': 'SSH操作影片.html'}, {'title': 'W17查驗考試', 'text': '\n', 'tags': '', 'url': 'W17查驗考試.html'}]};